import React from 'react';

const styles = {
  container: {
    backgroundColor: '#f0f0f0',
    padding: 16,
    borderRadius: 8,
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
  },
};

export default styles;
